import { Routes } from '@angular/router';
import { WelcomeComponent } from './welcome/welcome.component';
import { DashboardComponent } from './dashboard/dashboard.component';
// Remove imports for deleted components
// import { TaskListComponent } from './task-list/task-list.component';
// import { TaskDetailComponent } from './task-detail/task-detail.component';
// import { TeamMemberComponent } from './team-member/team-member.component';
// import { GanttChartComponent } from './gantt-chart/gantt-chart.component';
import { TeamsComponent } from './teams/teams.component';
import { ProjectsComponent } from './projects/projects.component';
import { TasksComponent } from './tasks/tasks.component';
import { CalendarComponent } from './calendar/calendar.component';
import { AuthGuard } from './guards/auth.guard';

// Define and export the routes array
export const appRoutes: Routes = [
  { path: '', component: WelcomeComponent },
  {
    path: 'auth',
    loadComponent: () => import('./auth/auth.component').then(m => m.AuthComponent)
  },
  {
    path: 'dashboard',
    loadComponent: () => import('./dashboard/dashboard.component').then(m => m.DashboardComponent),
    canActivate: [AuthGuard]
  },
  {
    path: 'projects',
    loadComponent: () => import('./projects/projects.component').then(m => m.ProjectsComponent),
    canActivate: [AuthGuard]
  },

  {
    path: 'tasks',
    loadComponent: () => import('./tasks/tasks.component').then(m => m.TasksComponent),
    canActivate: [AuthGuard]
  },
  {
    path: 'teams',
    loadComponent: () => import('./teams/teams.component').then(m => m.TeamsComponent),
        canActivate: [AuthGuard]
  },
  {
    path: 'sidebar',
    loadComponent: () => import('./sidebar/sidebar.component').then(m => m.SidebarComponent),
            canActivate: [AuthGuard]
  },
  {
    path: 'calendar',
    loadComponent: () => import('./calendar/calendar.component').then(m => m.CalendarComponent),
        canActivate: [AuthGuard]
  },
];
